    <style type="text/css">
      .loader {
        display: none;
        position: absolute;
        top: 0;
        left: 0;
        right: 0;
        bottom: 0;
        width: 100%;
        height: 100%;
        text-align: center;
        background: #fff;
        z-index: 999999991;
      }
      .loader.transparent {
        background-color: rgba(255, 255, 255, 0.7);
      }
      .loader.active {
        display: flex;
        align-items: center;
        justify-content: center;
      }
      .app-go .loader {
        background-image: url(data:image/png;base64,);
        background-repeat: no-repeat;
        background-position: center;
        background-size: contain;
        background-color: #f7f8fc;
      }
      .app-go .loader.transparent {
        background-color: rgba(255, 255, 255, 0.7);
        background-position: 0 80px;
        background-size: 150px;
      }
      .progress-bar {
        width: 300px;
        z-index: 1000000;
        background: 0 0;
        text-align: center;
        height: 100%;
      }
      .progress-bar .logo {
        height: 50%;
        width: 100%;
        display: flex;
        align-items: flex-end;
        justify-content: center;
      }
      .progress-bar .logo-img {
        max-width: 200px;
        margin-bottom: 16px;
      }
      .progress-bar-content-name {
        display: none;
        margin-top: 16px;
        box-sizing: border-box;
        font-size: 120%;
        font-family: Comfortaa, sans-serif;
        color: #60707b;
      }
      .progress-bar-line-box {
        width: calc(100% + 4px);
        height: 20px;
        box-sizing: border-box;
        border: 1px solid #60707b;
        border-radius: 10px;
        padding: 2px;
        top: 50%;
        background: #fff;
      }
      .progress-bar-line {
        height: 100%;
        background: #4053a0;
        box-sizing: border-box;
        border-radius: 12px;
      }
      .progress-bar-label-wrapper {
        display: inline-block;
        margin-top: 15px;
      }
      .progress-bar-label {
        font-family: Comfortaa;
        font-size: 16px;
        color: #5c707c;
      }
      .progress-bar-icon {
        width: 18px;
        height: 18px;
        margin-right: 6px;
        display: inline-block;
        background-image: url(data:image/svg+xml;base64,);
        background-size: 20px;
      }
      .app-go .progress-bar {
        width: 100%;
        background-color: #fff;
        position: absolute;
        bottom: 0;
        height: auto;
        padding-top: 60px;
        padding-bottom: 60px;
      }
      .app-go .transparent .progress-bar {
        background-color: transparent;
        top: 200px;
        bottom: auto;
      }
      .app-go .progress-bar .logo {
        position: fixed;
        top: 6%;
        height: auto;
      }
      .app-go .progress-bar .logo-img {
        max-width: 240px;
      }
      .app-go .progress-bar-line-box {
        width: calc(80% + 20px);
        margin: 0 auto;
      }
      .app-go .progress-bar-content-name {
        display: none;
        box-sizing: border-box;
        font-size: 100%;
        font-family: "Source Sans Pro", Arial, sans-serif;
        color: #60707b;
        width: 80%;
        text-align: left;
        margin: 0 auto 16px;
        text-overflow: ellipsis;
        overflow: hidden;
        white-space: nowrap;
      }
      .app-go .progress-bar-label-wrapper {
        display: none;
      }
    </style>
    <link
